def solution(stdin: str) -> str:
    N, M = map(int, stdin.split()[:2])
    H = list(map(int, stdin.split()[2:2+N]))
    A, B = [], []
    for _ in range(M):
        A.append(int(stdin.split()[2+N+_*2]))
        B.append(int(stdin.split()[2+N+_*2+1]))

    good_observatories = 0
    visited = [False] * N

    def dfs(node: int) -> None:
        nonlocal good_observatories
        visited[node] = True
        max_elevation = -1
        for neighbor in (A if node != A[i] else B for i in range(M) if A[i] == node or B[i] == node):
            if not visited[neighbor]:
                dfs(neighbor)
                max_elevation = max(max_elevation, H[neighbor])

        if max_elevation < H[node]:
            good_observatories += 1

    for i in range(N):
        if not visited[i]:
            dfs(i)

    return good_observatories

