    import re

    def replace_first_letter(word: str) -> str:
        consonants = 'bcdfghjklmnpqrstvwxyz'
        first_letter = word[0].lower()
        if first_letter in consonants:
            nearest_consonant = min(consonants, key=lambda x: abs(ord(x) - ord(first_letter)))
            word = nearest_consonant + word[1:]
        return word

    def replace_consonants(word: str) -> str:
        for i in range(1, len(word)):
            if word[i].isalpha() and not word[i-1].isalpha():
                if word[i].lower() in 'bcdfghjklmnpqrstvwxyz':
                    word = word[:i] + word[i].lower() + word[i+1:]
                elif word[i].lower() in 'aeiou':
                    word = word[:i] + word[i].upper() + word[i+1:]
                else:
                    word = word[:i] + word[i] + word[i+1:]
        return word

    def add_suffix(word: str) -> str:
        last_consonant_index = max(i for i, c in enumerate(word) if c.isalpha())
        last_consonant = word[last_consonant_index]
        if last_consonant in 'bcdfghjklmnpqrstvwxyz':
            return word[:last_consonant_index+1] + 'ah'
        elif last_consonant in 'aeiou':
            return word[:last_consonant_index+1] + 'oh'
        else:
            return word[:last_consonant_index+1] + 'uh'

    def convert_sentence(sentence: str) -> str:
        words = re.split(r'[-\s]', sentence)
        for i in range(len(words)):
            words[i] = replace_first_letter(words[i])
            words[i] = replace_consonants(words[i])
            words[i] = add_suffix(words[i])
        return ' '.join(words)

