                        elif y+2 < C and grid[x][y+2] == word[k]:
                            y += 2
                        elif y > 0 and grid[x][y-1] == word[k]:
                            y -= 1
                        else:
                            return False
                    return True
        return False

    def min_word(words: list) -> str:
        return min(filter(lambda x: len(x) >= 2, words))

