    rows = ["" for _ in range(5)]

    def add_frame(row, frame, letter, position):
        rows[row] += frame[position] + letter + frame[position]

    def peter_pan_frame(letter):
        return "..#..\n.#.#.\n#.{}.#\n.#.#.\n..#..".format(letter)

    def wendy_frame(letter):
        return "..*..\n.*.*.\n*.{}.*\n.*.*.\n..*..".format(letter)

    for i, letter in enumerate(word):
        if i % 3 == 0:
            frame = peter_pan_frame(letter)
        else:
            frame = wendy_frame(letter)
        add_frame(i // 5, frame, letter, 1)
        add_frame(i // 5, frame, letter, 3)
        add_frame(i // 5, frame, letter, 5)

    return "\n".join(rows)

